#
# Structure for table "qunar_hotels"
#

DROP TABLE IF EXISTS `qunar_hotels`;
CREATE TABLE `qunar_hotels` (
  `id` varchar(255) NOT NULL DEFAULT '0' COMMENT '酒店ID',
  `name` varchar(255) DEFAULT '' COMMENT '酒店名称',
  `comment_count` int(10) DEFAULT '0' COMMENT '酒店的评价总数',
  `goods_rate` varchar(255) DEFAULT '0' COMMENT '酒店的好评率',
  `goods_count` int(10) DEFAULT '0' COMMENT '酒店的好评数',
  `bads_count` int(10) DEFAULT '0' COMMENT '酒店的差评数',
  `mids_count` int(10) DEFAULT '0' COMMENT '酒店的中评数',
  `created_at` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='去哪儿酒店表';

