#
# Structure for table "users"
#

DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` varchar(255) NOT NULL DEFAULT '0' COMMENT '用户id',
  `hotel_id` varchar(255) DEFAULT NULL COMMENT '酒店id',
  `usernickname` varchar(255) DEFAULT NULL COMMENT '用户名',
  `userlevel` varchar(255) DEFAULT NULL COMMENT '用户等级',
  `userstat` varchar(255) DEFAULT NULL,
  `comment_count` int(11) DEFAULT NULL COMMENT '点评数',
  `specialist_comment_count` int(11) DEFAULT NULL COMMENT '砖家点评数',
  `track_cities` int(11) DEFAULT NULL COMMENT '去过几个城市',
  `title` varchar(255) DEFAULT NULL COMMENT '评论标题',
  `like_count` int(11) DEFAULT NULL COMMENT '有用数',
  `reply_count` int(11) DEFAULT NULL COMMENT '回复数',
  `star` int(11) DEFAULT NULL COMMENT '对酒店的评分',
  `comment` varchar(255) DEFAULT NULL COMMENT '评论',
  `checkin_time` varchar(255) DEFAULT NULL COMMENT '入住时间',
  `checkin_reason` varchar(255) DEFAULT NULL COMMENT '入住理由',
  `from` varchar(255) DEFAULT NULL COMMENT '发布评论的渠道',
  `created_at` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

